DocValuesFieldUpdates getUpdates(String field, FieldInfo.DocValuesType type) {
  switch (type) {
    case NUMERIC:
      return numericDVUpdates.get(field);
    case BINARY:
      return binaryDVUpdates.get(field);
    default:
      throw new IllegalArgumentException("unsupported type: " + type);
  }
}

